export class JsObject extends Component {
    constructor(){
        super()
        this.state={
            person :{
                firstname: "John",
                lastname: "Doe",
                age: 50,
                eyecolor: "blue"
              }
        }
    }
    render() {
        return (
            <div>
              <h1>Js Object</h1>  
            </div>
        )
    }
}

export default JsObject
